import React from 'react';
import { Link } from 'react-router-dom';
import { Menu, Icon, Dropdown, Segment, Select} from 'semantic-ui-react';

function NavBar({ currentUser, setCurrentUser }) {

    function logout(){
        setCurrentUser(null);
    }

    return(
        <Menu class="ui selection dropdown">
            <Dropdown attached="top" name="dropdown">
                <Dropdown.Menu class="dropdown">
                    <Dropdown.Item  as={Link} to="/">
                        <Icon name="dropdown" />
                        <span className="text">Raregifs</span>
                    </Dropdown.Item>
                    <Dropdown.Item  as={Link} to="/users">
                        Collections
                    </Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        </Menu>
    ); 
}

export default NavBar;
